CREATE TABLE `review_links` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `logo` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `url_slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `campaign_id` int(10) unsigned DEFAULT NULL,
  `auto_approve` tinyint(4) DEFAULT '0' COMMENT '0-> off, 1->on',
  `min_rating` int(11) DEFAULT NULL,
  `negative_info_review_msg_1` text COLLATE utf8mb4_unicode_ci,
  `negative_info_review_msg_2` text COLLATE utf8mb4_unicode_ci,
  `positive_review_msg` text COLLATE utf8mb4_unicode_ci,
  `created_by` int(10) unsigned NOT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `review_links_url_slug_unique` (`url_slug`),
  KEY `review_links_created_by_foreign` (`created_by`),
  KEY `review_links_campaign_id_foreign` (`campaign_id`),
  CONSTRAINT `review_links_campaign_id_foreign` FOREIGN KEY (`campaign_id`) REFERENCES `campaigns` (`id`),
  CONSTRAINT `review_links_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=144 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
