INSERT INTO `review_links` VALUES (1,'emv_logo_1542312696.png','Do you love Invoicing You? Please leave a review ...','Invoicing You','invoicingyou',107,1,3,'Sorry to hear that, we will definitely improve our service. Please leave your contact details so we can reach you','Thanks for sharing your contact details. A representative will reach you shortly','Thanks, we are making sure that you keep loving our product and using it.',1,NULL,'2018-11-14 23:02:30','2019-01-09 10:46:34'),(2,'emv_logo_1542379532.png','Love Sticky Reviews? Please review our software ...','Sticky Reviews','sticky-reviews',5,1,3,'Sorry to hear that, we are working hard to improve our service. Please provide your contact details, so we can contact you and listen to you directly about the software','Thanks for sharing your contact details. We will contact you and listen to your thoughts soon and will improve our service.','Thank you for reviewing us',1403,'2018-11-26 15:03:43','2018-11-16 14:45:32','2018-11-26 15:03:43'),(3,'emv_logo_1542730342.jpeg','Test Description','New_Test','6nkjuqhyp',8,1,2,'Thank you for your Feedback.','We will get back to you soon','Thank you for your review. keep supporting us.',2,NULL,'2018-11-20 16:12:22','2018-11-20 16:12:22'),(4,'emv_logo_1542977807.jpeg','new','new name','ubju1ds7',12,1,1,'bhjdjhsdjb','dsddfdfs','gfuyhjhjvhju',2,NULL,'2018-11-23 12:56:47','2018-11-23 14:13:54'),(5,'emv_logo_1543022783.png','Please tell us what you think about Brisbane Property Specialists. We would love your feedback.','Brisbane Property Specialists RL','BPS_Review',10,1,4,'Sorry you had a bad experience, we would love to know where it went wrong so we could make it right..','Thank you and appreciate your feedback. We will take it on board for future improvements','We are so glad you had a good experience. It was a pleasure working with you.',2079,NULL,'2018-11-24 01:26:23','2018-11-24 03:32:12'),(6,'emv_logo_1543048549.jpeg','Test','Trevin likes Signs by Gina','https://signsbygina.com',13,1,4,'we would like to find out what we can do to correct or make you happy','we wil be in contact to fix any problem you may have','Thank You for the review, looking forward to seeing you again.',1961,NULL,'2018-11-24 08:35:49','2018-11-24 08:35:49'),(7,'emv_logo_1543244732.jpeg','This is the desicription','Sticky Reviews','leave-us-a-review',5,1,5,'Negative message 1','Negative message 2','positive review message',1403,NULL,'2018-11-26 15:05:32','2018-11-26 15:05:32'),(8,'emv_logo_1543536505.png','Testimoniales para Castle Dental','Castle Dental - Gina','ueayxdd5t',21,1,1,'Este es un mensaje negativo','Segundo mensaje negativo','¡Muchas gracias por tus increíbles palabras!',2804,NULL,'2018-11-30 00:08:25','2018-11-30 00:08:25'),(9,'emv_logo_1543637546.png','Let me know if my programs have worked for you!','Leave Me A Review?','68t5lukjo',26,1,5,'I\'m sorry to hear that I haven\'t helped you.','Leave you info and I\'ll contact you about how I can fix it.','Thank you so much for the review!',2837,NULL,'2018-12-01 04:10:24','2018-12-01 04:12:26'),(10,'emv_logo_1543940528.png','Leave a Review.\nWe Love to hear about your health & success... \nFill in the information below and let us know...:)','Let Us Know How We Are Doing?','rivuno9au',37,1,5,'Sorry to hear about this, please send us an email at support@my2048.com so we can help with the issue.','Sorry to hear about this, please send us an email at support@my2048.com so we can help with the issue.','Thank you so much for you kind words.  Let us know how we can improve even more.',2867,NULL,'2018-12-04 16:22:08','2018-12-04 16:39:18'),(11,'emv_logo_1543943012.png','Let Us Know How We Are Doing?','Totally Mutts','d92w554p5',38,0,NULL,'We are sorry to hear about this, please contact us so we can better help you.','Again, we are sorry you had an experience that was not optimal. Please contact us so we can sort this out.','Thank you for your generous review. We look forward to serving you.',2867,NULL,'2018-12-04 17:03:32','2018-12-04 17:03:32'),(12,'emv_logo_1544008393.jpg','Please review us','Reputation management','v4vrkrtgq',43,1,4,'soory for what happened to you','we will reach you out to sort out the problem you have faced','Thanks for the review !! We love our users',2130,NULL,'2018-12-05 11:13:13','2018-12-05 11:13:13'),(13,'emv_logo_1544031572.png','Tell us what you thought about the Automated Prospecting Mini-Course. We appreciate all feedback and we love all our users!','Automated Prospecting Mini-Course','4lxo47xcz',16,1,4,'We’re so sorry you feel this way, but we really want to make it right. Can you please help us out and give us a little more information so we can reach out to you and make it all better? Thank you!','Again, we are really sorry for this, we will make it better. We appreciate all feedback. Thank you very much.','Thank you so much for your feedback- We love you!',2075,NULL,'2018-12-05 17:39:32','2018-12-05 17:39:32'),(14,'emv_logo_1544031725.png','Very Good,nice ,excellent','Sohan Bk','0phbp303l',44,1,4,'no','No cmnts','Execllent',2914,NULL,'2018-12-05 17:42:05','2018-12-05 17:42:05'),(15,'emv_logo_1544051274.jpg','Thank you for working with us. We would love to hear your feedback','BPS Review Link','BPS-Review',45,1,4,'We are sorry to hear you had a bad experience with us.','We will take your feedback on board to continue to improve our service. Thank you for your feedback.','Thank you so much for your positive feedback. It was a pleasure working with you.',2905,NULL,'2018-12-05 23:07:54','2018-12-05 23:10:15'),(16,'emv_logo_1544598680.png','Thank you for review. You review will be published very soon','New Review Link','srlnk',8,1,3,'It is the Negative Info1','It is the Negative Info2','It is the Positive Info Message',2,NULL,'2018-12-12 07:11:20','2018-12-12 07:11:31'),(17,'emv_logo_1544723321.png','Terassah @ All Web LLC is your go-to webmaster. From web design to marketing, my brand is better for using her services.','McKesur Finch','finch',55,1,5,'Hey. Thanks for your honest feedback... did you let Terassah know about your dissatisfaction?','Hey. Thanks for providing feedback... did you let Terassah know about your dissatisfaction?','Thank you for leaving a review. We appreciate you allowing All Web LLC to service your digital marketing needs.',2961,NULL,'2018-12-13 17:48:41','2018-12-13 17:48:41'),(18,'emv_logo_1544823156.png','We would love to know if you\'ve enjoyed any of our live trainings?','Facebook Trainings','trainings',57,0,NULL,'We\'re so sorry about your experience. Please let us know if we can do anything by sending us an e-mail at cb101help@gmail.com','We\'re so sorry about your experience. Please let us know if we can do anything by sending us an e-mail at cb101help@gmail.com','Thanks so much! Please feel free to invite others to our Facebook group!',1656,NULL,'2018-12-14 21:32:36','2018-12-14 21:32:36'),(19,'emv_logo_1544916292.png','Would you be willing to give us your feedback on the Sales Automation Trainings?','Sales Automation Accelerator','accelerator',60,0,NULL,'We\'re so sorry to hear about that. Please send us a message at cb101help@gmail.com so we can help solve your frustration.','We\'re so sorry to hear about that. Please send us a message at cb101help@gmail.com so we can help solve your frustration.','Thanks so much for your review! Feel free to share our program with your friends!',1656,NULL,'2018-12-15 23:24:52','2018-12-15 23:24:52'),(20,'emv_logo_1545604782.png','Our Business Videos are professionally scripted and created and inserted in one of our custom designed wrappers to create a stunning eye catching video.','Business Video Reviews','3kxhddgj7',67,1,4,'Sorry to hear that we did not meet your expectation factor. Is there something we can do to earn a better rating?','We are so sorry that we did not provide you with the greatest experience possible. We take all reviews seriously and would like your input into what we can do to improve?','Hey thanks so much for the a